import React, { useState, useEffect } from 'react';
import MediaService from './MediaService'; // Adjust the import based on your project structure

const MediaLister = () => {
  const [medias, setMedias] = useState([]);
  const [filters, setFilters] = useState({
    name: '',
    genre: '',
    rating: ''
  });
  const [sortConfig, setSortConfig] = useState({ key: 'name', direction: 'asc' }); // Default sort by name

  // Fetch data with filters and sorting
  const fetchMedias = () => {
    console.log('Filters:', filters); // Debugging
    console.log('Sort Config:', sortConfig); // Debugging
    
    MediaService.getAll(filters, sortConfig)
      .then(response => {
        console.log('Fetched media:', response); // Debugging
        setMedias(response.data);
      })
      .catch(error => console.error(error));
  };  

  // Run the fetch whenever filters or sortConfig changes
  useEffect(() => {
    fetchMedias();
  }, [filters, sortConfig]);

  const handleDelete = (mediaId) => {
    MediaService.delete(mediaId)
      .then(() => {
        // Remove the deleted media from state (UI update)
        setMedias(medias.filter(media => media.mediaId !== mediaId));
      })
      .catch(error => console.error("Error deleting media:", error));
  };

  // Handle filter input changes
  const handleFilterChange = (key, value) => {
    setFilters(prevFilters => ({
      ...prevFilters,
      [key]: value
    }));
  };

  // Handle sorting logic
  const handleSort = (key) => {
    let direction = 'asc';
    if (sortConfig.key === key && sortConfig.direction === 'asc') {
      direction = 'desc';
    }
    setSortConfig({ key, direction });
  };

  return (
    <div className="list-page">
      {/* Filter Controls */}
      <div className="filter-container">
        <div className="filter-box">
          <label className="filter-label">Search by Name</label>
          <input
            type="text"
            className="filter-input"
            value={filters.name}
            onChange={e => handleFilterChange('name', e.target.value)}
          />
        </div>
        <div className="filter-box">
          <label className="filter-label">Search by Genre</label>
          <input
            type="text"
            className="filter-input"
            value={filters.genre}
            onChange={e => handleFilterChange('genre', e.target.value)}
          />
        </div>
        <div className="filter-box">
          <label className="filter-label">Search by Rating</label>
          <input
            type="number"
            className="filter-input"
            value={filters.rating}
            onChange={e => handleFilterChange('rating', e.target.value)}
          />
        </div>
      </div>

      {/* Sorting controls */}
      <div className="sort-container">
        <button className="sort-button" onClick={() => handleSort('name')}>
          Sort by Name {sortConfig.key === 'name' ? (sortConfig.direction === 'asc' ? '↑' : '↓') : '⇅'}
        </button>
        <button className="sort-button" onClick={() => handleSort('genre')}>
          Sort by Genre {sortConfig.key === 'genre' ? (sortConfig.direction === 'asc' ? '↑' : '↓') : '⇅'}
        </button>
        <button className="sort-button" onClick={() => handleSort('rating')}>
          Sort by Rating {sortConfig.key === 'rating' ? (sortConfig.direction === 'asc' ? '↑' : '↓') : '⇅'}
        </button>
      </div>

      {/* Table */}
      <div className="table">
        {medias.map(media => (
          <div key={media.mediaId} className="table-row">
            <div className="form-field">{media.name}</div>
            <div className="form-field">{media.genre}</div>
            <div className="form-field">{media.rating}</div>
            <div className="form-field">{media.duration}</div>
            <div className="form-field">
              <button className="modify-button">Edit</button>
              <button className="delete-button" onClick={() => handleDelete(media.mediaId)}>Delete</button>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default MediaLister;
